//}}}
//{{{  utils

//{{{  myround

function myround(x) {
  return Math.sign(x) * Math.round(Math.abs(x));
}

//}}}
//{{{  docmd

function docmd(x) {
  onmessage({data: x});
}

//}}}

//}}}
//{{{  activations

function relu(x) {
  return Math.max(0, x);
}

//
// Thanks @ciekce for pointing me at screlu, which become sqrrelu
// in my unquantised network and gained significantly over relu.
//

function sqrrelu(x) {        // Use Bullet naming convention.
  const y = Math.max(0, x);
  return y * y;
}

