lozBoard.prototype.addHistory = function (x, move) {

  const to    = (move & MOVE_TO_MASK)    >>> MOVE_TO_BITS;
  const frObj = (move & MOVE_FROBJ_MASK) >>> MOVE_FROBJ_BITS;

  this.objHistory[frObj][to] += x;

}

